import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/Home';
import Hospitals from './components/Hospitals';
import Medicals from './components/Medicals';
import Diagnostics from './components/Diagnostics';

function App() {
  const [searchResults, setSearchResults] = useState(null);

  const handleSearch = (query) => {
    // Logic to handle search results based on the query
    const hospitals = ['holy family', 'shruti nursing', 'symbiosis speciality', 'lilavati hospital'];
    const medicals = ['bandra medical store', 'shree ganesh medical', 'care chemist', 'wellness forever'];
    const diagnostics = ['thyrocare', 'suburban diagnostics', 'dr lal pathlabs'];

    // Normalize the query to lowercase for comparison
    query = query.toLowerCase();

    if (hospitals.includes(query)) {
      setSearchResults('hospitals');
    } else if (medicals.includes(query)) {
      setSearchResults('medicals');
    } else if (diagnostics.includes(query)) {
      setSearchResults('diagnostics');
    } else {
      setSearchResults(null);
    }
  };

  return (
    <Router>
      <div>
        <Navbar onSearch={handleSearch} />
        <Routes>
          <Route path="/" element={<Home searchResults={searchResults} />} />
          <Route path="/hospitals" element={<Hospitals searchResults={searchResults} />} />
          <Route path="/medicals" element={<Medicals searchResults={searchResults} />} />
          <Route path="/diagnostics" element={<Diagnostics searchResults={searchResults} />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
